"use strict";module.exports=function(){return{items:[{name:"Лето в пионерском галстуке",id:1},{name:"О чём молчит ласточка",id:2},{name:"Благословение небожителей. Том 2",id:3},{name:"Благословение небожителей. Том 1",id:4},{name:"KGBT+",id:5},{name:"Бессмертный",id:6},{name:"История ворона",id:7},{name:"Отдел деликатных расследований",id:8},{name:"Принцесса америки",id:9},{name:"Благословение небожителей. Том 3",id:10},{name:"Мама слышит тебя",id:11},{name:"Лисья нора",id:12}],lines:[{imgsource:"../Style/Image/Каталог/Каталог 1.png",price:391,title:"Лето в пионерском галстуке",name:"Катерина Сильванова, Елена Малисова",description:"Спустя двадцать лет музыкант Юрий Конев возвращается на место, где когда-то находился пионерский лагерь «Ласточка», и вспоминает проведённое там лето 1986 года и свою влюблённость в вожатого — студента МГИМО Владимира Давыдова. Юра и Володя совместно занимались постановкой спектакля, и при этом между ними возникла крепкая дружба, постепенно переросшая в подростковую любовь. На протяжении всего сюжета книги Володя не принимает свою гомосексуальную ориентацию, периодически настаивая на прекращении отношений и объясняя это тем, что он пытается «сбить Юру с верного пути», и внутренней гомофобией. В конце лагерной смены юноши зарывают под ивой своего рода «капсулу времени», договорившись вырыть её через десять лет[1]. После расставания Юра и Володя какое-то время продолжают общение по переписке, но через некоторое время они теряют связь друг с другом. В 2006 году, найдя капсулу, Юра узнаёт из письма Володи, что тому не удалось «победить» свою ориентацию и он по-прежнему любит Юру.",id:1},{imgsource:"../Style/Image/Каталог/Каталог 2.png",price:424,title:"О чём молчит ласточка",name:"Катерина Сильванова, Елена Малисова",description:"В 1986 году в лагере «Ласточка» Володя встретил самого важного человека в своей жизни. Судьба развела героев, однако память о той смене они смогли пронести сквозь годы разлуки. Спустя двадцать лет Володя и Юра встретятся снова. Два совершенно разных человека с тяжелым прошлым — какое будущее их ждет? И есть ли у них это будущее?",id:2},{imgsource:"../Style/Image/Каталог/Каталог 3.png",price:1250,title:"Благословение небожителей. Том 2",name:"Мосян Тунсю",description:"Всё в этом мире имеет счёт: и удача, и невезение.Беды преследуют Се Ляня одна за другой: вот он ненароком устроил поджог, а вот столкнулся с призраками прошлого, о которых предпочёл бы забыть…Восемьсот лет назад он был любимцем толпы, а матушка, отец и советник возлагали на него большие надежды. Слава о его подвигах стремительно достигла Небес, и в год своего семнадцатилетия Се Лянь вознёсся. Однако радость была скоротечна: в государстве Сяньлэ настали тяжёлые времена. Видя страдания своего народа, принц был не в силах остаться в стороне. Но может ли бог выбирать чью-то сторону?",id:3},{imgsource:"../Style/Image/Каталог/Каталог 4.png",price:1150,title:"Благословение небожителей. Том 1",name:"Мосян Тунсю",description:"В незапамятные времена Се Лянь был наследным принцем государства Сяньлэ. Судьба одарила его всем: прекрасным ликом, чистыми помыслами и бесконечной любовью своих подданных. И если уж кому-то и было предначертано стать Божеством, то именно Его Высочеству.Однако удержаться на Небесах оказалось для него не так просто. Се Лянь возносился дважды и дважды был изгнан на землю. И вот спустя восемьсот лет скитаний Его Высочество вновь возвращается в Небесные чертоги. Получив своё первое задание в роли Божества, он сталкивается с таинственным и невероятно могущественным демоном, который, как оказалось, уже давно положил глаз на наследного принца...Мосян Тунсю — настоящая звезда жанра данмей. На её счету уже несколько произведений, получивших признание не только в Сети. В 2014 писательница заключила контракт с крупным порталом интернет-литературы «Цзиньцзян», а её книги издаются большими тиражами по всему миру.«Благословение Небожителей» — третий по счёту роман писательницы — в мгновение ока успел стать хитом не только в Китае, но и за его пределами. История получила 2 экранизации (сериал и мультсериал), а также графическую адаптацию.",id:4},{imgsource:"../Style/Image/Каталог/Каталог 5.png",price:949,title:"KGBT+",name:"Виктор Пелевин",description:"Виктор Пелевин снова вытащил из ноосферы предчувствия и вероятности, чтобы рассказать читателям о мире, в котором они живут. Он пересобрал реальность, ничего не изменяя, но объясняя каждое событие, запустившее падение костяшек домино, которое мы наблюдаем сейчас. Проза Пелевина — как ее ни назови: метаирония, научная фантастика, психоделика, новая итерация большого русского романа — это ежегодный скрупулезный анализ актуальной объективности. И именно объяснения происходящего читатели ждут. И они его получат.",id:5},{imgsource:"../Style/Image/Каталог/Каталог 6.png",price:698,title:"Бессмертный",name:"Кориандр",description:"Бес|смертный — история, вдохновленная сказками о Кощее Бессмертном и Иване-царевиче....черное — белое, воля — неволя, любовь — ненависть. Что ты будешь делать, когда все перемешается? Когда на белом проступит чернота, когда несвобода избавит от темного гнета души, когда тот, кого ненавидел...Что ты будешь делать?История о боли, потерях, отмщении и сломанных судьбах. Но всегда есть место свету, надежде и прощению, даже когда мрак наступает.",id:6},{imgsource:"../Style/Image/Каталог/Каталог 7.png",price:721,title:"История ворона",name:"Кэт Уинтерс",description:"Развеселая книга, которой совершенно не ждешь от скандинавского автора. А как же мрак? А как же кровища? Загадочные маньяки как же? Приятный шведский городок Мальме, наверное, временами потрясают жуткие преступления, но не в мире этого романа.Встречайте детектива Варга и его отдел деликатных расследований, который берется за самые необычные преступления. Это не та книга, которую читаешь, судорожно перелистывая одну заляпанную кровью страницу за другой. Нет, сначала ты недоумеваешь, потом начинаешь хихикать в кулак, задумываешься, берешь за пуговицу ближнего и зачитываешь ему кусок вслух, а потом книга кончается… а хочется еще",id:7},{imgsource:"../Style/Image/Каталог/Каталог 8.png",price:101,title:"Отдел деликатных расследований",name:"Александр Дверьной",description:"Развеселая книга, которой совершенно не ждешь от скандинавского автора. А как же мрак? А как же кровища? Загадочные маньяки как же? Приятный шведский городок Мальме, наверное, временами потрясают жуткие преступления, но не в мире этого романа.Встречайте детектива Варга и его отдел деликатных расследований, который берется за самые необычные преступления. Это не та книга, которую читаешь, судорожно перелистывая одну заляпанную кровью страницу за другой. Нет, сначала ты недоумеваешь, потом начинаешь хихикать в кулак, задумываешься, берешь за пуговицу ближнего и зачитываешь ему кусок вслух, а потом книга кончается… а хочется еще",id:8},{imgsource:"../Style/Image/Каталог/Каталог 9.png",price:99,title:"Принцесса америки",name:"Катарина Магки",description:"Катарина Макги — автор бестселлеров New York Times — создала мир, в котором США управляет монарх. И одна из главных героинь романа вот-вот должна стать королевой!Права на книгу проданы в 16 стран мира!«American Royals» — это сериал «Сплетница» + сериал «Корона». Этот роман для всех, кто любит следить за жизнью членов королевской семьи! Для тех, кто обожает сплетни, интриги, придворные скандалы в красивом антураже дворцов, имений и частных самолетов. Это история королевской семьи без прикрас, полная скандальных секретов, тайн и любви.",id:9},{imgsource:"../Style/Image/Каталог/Каталог 10.png",price:1250,title:"Благословение небожителей. Том 3",name:"Мосян Тунсю",description:"ДЛЯ МЕНЯ ЕДИНО, ОКРУЖЁН ТЫ СИЯНИЕМ ИЛИ ПОВЕРЖЕН В ГРЯЗЬ. ЗНАЧЕНИЕ ИМЕЕШЬ ТОЛЬКО ТЫ САМ.Близится Праздник середины осени, а вместе с ним — роскошный пир и Состязание фонарей в небесных чертогах. Отправляясь на торжество, Се Лянь не подозревает, что окажется в центре внимания. По возвращении в мир смертных он принимается за работу, ведь теперь нужно прокормить сразу три лишних рта! К несчастью, на задании, которое получил принц, он вновь сталкивается с озлобленным духом младенца, однако Хуа Чэн успевает прийти на выручку.После всей неразберихи герои решают отдохнуть — но не тут-то было! На пороге храма Водяных Каштанов возникает Ши Цинсюань в сопровождении Мин И. Оказывается, Повелителя Ветра уже довольно давно преследует одна тварь: божок-пустозвон. Се Лянь соглашается помочь и расправиться с ним, и тут дело принимает совсем дурной оборот...",id:10},{imgsource:"../Style/Image/Каталог/Каталог 11.png",price:645,title:"Мама слышит тебя",name:"Лиза Мока",description:"«Мама слышит тебя» – книга, благодаря которой вы поймете, что идеальных родителей не существует. Лиза Мока уверена: прежде всего каждому из нас необходимо понять, что мы представляем из себя – какие в нас есть качества и реакции как в родителях, и как не винить себя за них, а знать, понимать, принимать и грамотно использовать. Книга научит видеть в себе-родителе идеального творца, а также любить своего ребенка – его самого, а не свои желания и надежды в нем.",id:11},{imgsource:"../Style/Image/Каталог/Каталог 12.png",price:509,title:"Лисья нора",name:"Сакавич Нора",description:"Сенсационная трилогия писательницы Норы Сакавич «Все ради игры» была впервые опубликована в интернете и молниеносно покорила читателей во всем мире. «Лисья нора» повествует о команде «Лисов» — игроков экси (вымышленный спорт), которые, будучи отбросами в жизни, пытаются подняться со дна турнирной таблицы и выиграть чемпионат страны. Главный герой, Нил Джостен, скрывается от своего темного прошлого, однако, став частью команды, вынужден сражаться не только с соперниками, но и с новоиспеченными товарищами, каждый из которых хранит свои секреты.",id:12}]}};
